import './Header.css';

const Header = () => {
    return (
        <header className="menu">
            <h1>Hello</h1>
            <img src="public/react-logo.svg" alt="react logo" />
            <img src="./menu-top.svg" alt="logo" />
        </header>
    )
}

export default Header
